import Header from './header.js'
import Home from './home.js'
import Shop from './shop.js'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import './App.scss';

function App() {
  return (
    <Router>
    <div className="App">
      <Header />
      <Switch>
      <Route exact path="/">
        <Home/>
      </Route>
      <Route path="/shop">
        <Shop/>
      </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
